description:
Hecticube is a hectic, minimalistic, sports action-arcade experience. It's an explosive new take on familiar games we know and love. It places you in a fast-paced multiplayer arena that will put your focus, speed, and dexterity to the test. 

Players shoot the ball to hit the opponent's goal. With every impact, the goal shrinks. Each goal has a maximum number of hits before it completely diminishes and the game is over.

